import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    root: {
        // minHeight: '100vh',
        backgroundColor: '#808080'
    },
    card: {
        maxWidth: 345,
        borderRadius: 25,
        border: '2px solid',
        minWidth: 282.833
    }
}));

export default useStyles;
